import React from 'react';
import Logo from '../../assets/img/Gatonetiflix.png';
import './Menu.css';
import './Menu.css'
import Button from '../Button'
function Menu(){
    return(
        <nav className="Menu">
            <a href="/"> 
            <img className="Logo" src={Logo} alt= "gatonetflix logo"/>
            </a>

            <Button as className="ButtonLink" href="/">
                Novo v√≠deo
            </Button>
        </nav>
    );
}

 export default Menu;
